// src/pages/Home.jsx
import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import FooterNav from "../components/FooterNav";
import Carousel3D from "../components/Carousel3D"; // это создадим отдельно

const Wrapper = styled.div`
  background: black;
  color: white;
  min-height: 100vh;
  overflow: hidden;
`;

const Home = () => {
  return (
    <Wrapper>
      <Navbar />
      <Carousel3D />
      <FooterNav />
    </Wrapper>
  );
};

export default Home;
